webpackJsonp([94860427218964],{419:function(e,i){e.exports={data:{contentfulBlogPost:{title:"Where from to get Traffic",slug:"where-from-to-get-traffic",publishDate:"1457384400000",content:[{__typename:"ContentfulBlogPostCopy",id:"c6tTBu4KUhyKQesEaUqeQIe",copy:{childMarkdownRemark:{html:'<p>Hi, there!</p>\n<p>About a month ago, one man came to our University and started handling one course called <a href="http://i-sprint.kz/">“Moneymaking”</a>(thanks to our <a href="http://sdu.edu.kz/en/programs/5b070300-information-systems/">Head of Information Systems Department</a> - <em>Mr. Meirambek Zhaparov</em>).</p>\n<p>This man really knows how to <em>make money</em>, and he is teaching us about it. Thanks to this course I launched my courses on Android development. If someone is interested, <a href="https://www.instagram.com/kursy_android/">visit my instagram page</a>.</p>\n<p>We call ourselves “Moneymakers”, and it is really <em>breathtaking</em>. Throughout this course I understood many things, and also it changed my mind, my views to some things.</p>\n<p>In this post, I will be doing my homework on this course. The homework was to find <em>20 channels, from where we can get traffic</em>(he said their actual number is more than 200).</p>'}}},{__typename:"ContentfulBlogPostImage",id:"c1tUj5TaOvuieqMC0smK48s",caption:null,image:{resolutions:{src:"//images.ctfassets.net/w1fxlmsi3y1l/2Pn7UWSTUcaqc24OkYoYKw/328bae93bf1df5c424cd46ae98da0824/instagram_app_android.jpg?w=400&q=100",srcSet:"//images.ctfassets.net/w1fxlmsi3y1l/2Pn7UWSTUcaqc24OkYoYKw/328bae93bf1df5c424cd46ae98da0824/instagram_app_android.jpg?w=400&h=267&q=100 1x,\n//images.ctfassets.net/w1fxlmsi3y1l/2Pn7UWSTUcaqc24OkYoYKw/328bae93bf1df5c424cd46ae98da0824/instagram_app_android.jpg?w=600&h=400&q=100 1.5x,\n//images.ctfassets.net/w1fxlmsi3y1l/2Pn7UWSTUcaqc24OkYoYKw/328bae93bf1df5c424cd46ae98da0824/instagram_app_android.jpg?w=800&h=533&q=100 2x,\n//images.ctfassets.net/w1fxlmsi3y1l/2Pn7UWSTUcaqc24OkYoYKw/328bae93bf1df5c424cd46ae98da0824/instagram_app_android.jpg?w=1200&h=800&q=100 3x"}}},{__typename:"ContentfulBlogPostCopy",id:"c4sevBv5Bq8sGsceiiM0WKM",copy:{childMarkdownRemark:{html:"<p>So, here is the list:</p>\n<ol>\n<li>VK</li>\n<li>YouTube</li>\n<li>Instagram</li>\n<li>Blog</li>\n<li>Periscope</li>\n<li>Twitter</li>\n<li>Mail.ru</li>\n<li>Email subscription</li>\n<li>yvision.kz</li>\n<li>Some other platforms(as olx, slando, satu)</li>\n<li>Google+</li>\n<li>Odnoklassniki</li>\n<li>Offline</li>\n<li>Forums</li>\n<li>Reddit</li>\n<li>TV channels</li>\n<li>LinkedIn</li>\n<li>QA sites(Quora)</li>\n<li>RSS Feed subscription</li>\n<li>Different meetups</li>\n</ol>"}}}]}},pathContext:{slug:"where-from-to-get-traffic"}}}});
